import React  from 'react'
import './YesButton.css'

var x = 40;
var y = 70;

class NoButton extends React.Component {
  constructor(props){
    super(props);
  }
  
  render(){
     
    var style = {
        left: x + '%',
        top: y + '%'
    }
    return (
        <div>
            <button className="Yes" onMouseEnter={()=>this.toggleHover()} onMouseLeave={()=>this.toggleHover()} style={style}>
                No
            </button>
      </div>
    );
  }
}
  
  export default NoButton;
